/**
 * @param {number[]} height
 * @return {number}
 */
var trapRainWater = function(height) {
	var m = height.length;
	if (m == 0) return 0;
	var n = height[0].length;
	if (m < 3 || n < 3) return 0;

	var count = [];
	for (var i = 0; i < m; i++) {
		count[i] = [];
	};


	var seaList = [];
	for (var i = 0; i < m; i++) {
		count[i][0] = height[i][0];
		count[i][n - 1] = height[i][n - 1];
		seaList.push([i, 0, height[i][0]]);
		seaList.push([i, n - 1, height[i][n - 1]]);
	}
	for (var j = 1; j < n - 1; j++) {
		count[0][j] = height[0][j];
		count[m - 1][j] = height[m - 1][j];
		seaList.push([0, j, height[0][j]]);
		seaList.push([m - 1, j, height[m - 1][j]]);
	}
	seaList.sort(function(a, b) {
		return a[2] - b[2];
	})

	var ret = 0;
	while (seaList.length) {

		var start = seaList.shift(),
			seaLevel = start[2],
			i = start[0],
			j = start[1];
		if (i > 0 && count[i - 1][j] == undefined) {
			if (seaLevel > height[i - 1][j]) {
				ret += seaLevel - height[i - 1][j];
				count[i - 1][j] = seaLevel;
				addNode(seaList, [i - 1, j, seaLevel]);
			} else {
				count[i - 1][j] = height[i - 1][j];
				addNode(seaList, [i - 1, j, height[i - 1][j]]);
			}
		}
		if (i < m - 1 && count[i + 1][j] == undefined) {
			if (seaLevel > height[i + 1][j]) {
				ret += seaLevel - height[i + 1][j];
				count[i + 1][j] = seaLevel;
				addNode(seaList, [i + 1, j, seaLevel]);
			} else {
				count[i + 1][j] = height[i + 1][j];
				addNode(seaList, [i + 1, j, height[i + 1][j]]);
			}
		}
		if (j > 0 && count[i][j - 1] == undefined) {
			if (seaLevel > height[i][j - 1]) {
				ret += seaLevel - height[i][j - 1];
				count[i][j - 1] = seaLevel;
				addNode(seaList,[i, j-1, seaLevel]);
			} else {
				count[i][j - 1] = height[i][j - 1];
				addNode(seaList,[i, j-1, height[i][j - 1]]);
			}
		}
		if (j < n - 1 && count[i][j + 1] == undefined) {
			if (seaLevel > height[i][j + 1]) {
				ret += seaLevel - height[i][j + 1];
				count[i][j + 1] = seaLevel;
				addNode(seaList,[i, j+1, seaLevel]);
			} else {
				count[i][j + 1] = height[i][j + 1];
				addNode(seaList,[i, j+1, height[i][j + 1]]);
			}
		}
		//console.log(count);
	}
	return ret;
};


var addNode = function(seaList, newNode) {
	var pos = seaList.findIndex(function(node) {
		return node[2] >= newNode[2];
	});
	seaList.splice(pos, 0, newNode);
};

